import React from "react";
import {Route , Switch,Redirect} from "react-router-dom";
import Home from './Home/Home';
import Products from './Products/Products';
import NotFound from './NotFound/NotFound';
import NavBar from "./NavBar/NavBar";
import Carts from './Carts/Carts';
import Login from './Login/Login';

class App extends React.Component {
    state={
        Products:[
            {id:1,name:"short",count:2,imgurl:"./imgs/01.jpg"},
            {id:1,name:"jeans",count:1,imgurl:"./imgs/02.jpg"},
            {id:1,name:"boot",count:4,imgurl:"./imgs/03.jpg"},
            {id:1,name:"cloves",count:7,imgurl:"./imgs/04.jpg"},
            {id:1,name:"sweat",count:3,imgurl:"./imgs/05.jpg"}

        ]
    }
    render() { 
        return(
            <React.Fragment>
                <NavBar></NavBar>

                <main className="container">
                        <Switch>
                            <Route path='/products' component={Products}/>
                            <Route path='/login' component={Login}/>

                            )}/>
                            <Route path='/home' component={Home}/>
                            <Route path='/notfound' component={NotFound}/>
                            <Redirect to='/notfound'/>
                        </Switch>
                    </main>
            </React.Fragment>
        )
    }
}

export default App;
